#include "Scanner.h"

//--------------------------------------------------------------------------------------------------------
Scanner::Scanner(string _input = "") : input(_input), numTokens(0)
{
    Tokens = new Simbolo[10000];//Arreglo de tokens
}
//--------------------------------------------------------------------------------------------------------
Scanner::Scanner(ifstream &ifs) : numTokens(0)
{
    Tokens = new Simbolo[10000];//Arreglo de tokens
    string str="",strline;
    int line=0;
    while(!ifs.eof())
    {
        getline(ifs,strline);
        line++;
        strline = strline + "\n";
        for(unsigned int j=0;j<strline.length();j++)
            str=str+strline[j];
    }
    input=str;
}
//--------------------------------------------------------------------------------------------------------
void Scanner::Leer()
{
    string pal="";
    int lookAhead = 0;
    unsigned int IndexInput=0; //Recorre todo el string para leer
    bool comentariosLinea = false, comentariosBloque = false, cadenas = false; //booleanos que indican si se estan leyendo comentarios y cadenas de texto

    while(input[IndexInput]==' ' || input[IndexInput]=='\n' || input[IndexInput]=='\t')    IndexInput++; //Quita espacios al principio del código (si los hay)

    for(int i=0;i<TAM_BUFFER;i++) Buffer[i] = input[i+IndexInput]; //llena por primera vez el buffer

    //ImprimeBuffer();

    while(lookAhead<TAM_BUFFER){
        if(IndexInput<=input.size()){ //Mientras existan caracteres que leer
//-----------DETECTA COMENTARIOS POR LINEA Y BLOQUE EN EL CÓDIGO-----------------------------------------------------
            if(Buffer[lookAhead]=='/'){
                if(Buffer[safeLookAhead(lookAhead+1)]=='/')   comentariosLinea = true;
                else if(Buffer[safeLookAhead(lookAhead+1)]=='*') comentariosBloque = true;
            }
//-----------DETECTANDO CUANDO TERMINAN LOS COMENTARIOS DE LINEA--------------------------------------
            if(comentariosLinea) if(Buffer[lookAhead] == '\n') comentariosLinea = false;
//----------SEPARADOR DE LEXEMAS ---------------------------------------------------------------------
            if(!comentariosLinea && !comentariosBloque && !cadenas){ //si no se estan leyendo comentarios
                if(Buffer[lookAhead] == ' ' || Buffer[lookAhead] == '\t' || Buffer[lookAhead] == '\n'){
                    if(pal.size()>0 && (pal!=" " || pal!="\t" || pal!="\n")) //evita lexemas vacios cuando hay 2 separadores de lexemas juntos.
                        getTokens(pal);
                    pal="";
                }else  if(Buffer[lookAhead] == '/' || Buffer[lookAhead] == '*' || Buffer[lookAhead] == '(' ||    Buffer[lookAhead] == ')' || Buffer[lookAhead] == '[' || Buffer[lookAhead] == ']' ||Buffer[lookAhead] == '{' || Buffer[lookAhead] == '}' || Buffer[lookAhead] == ';' ||Buffer[lookAhead] == '-' || Buffer[lookAhead] == '+' || Buffer[lookAhead] == '=' || Buffer[lookAhead] == ',')  {
                            if(pal.size()>0 ) //evita lexemas vacios cuando hay 2 separadores de lexemas juntos.
                                getTokens(pal);
                            pal=Buffer[lookAhead];
                            getTokens(pal);
                            pal="";
                }else
//--------------------------EVITA SEPARAR LEXEMAS DENTRO DE UNA CADENA-------------------------------
                if(Buffer[lookAhead]=='"' || Buffer[lookAhead]=='\''){
                    if(pal.size()>0)
                        getTokens(pal);
                    pal="";
                    cadenas=true;
                }
//-------------------------------------------------------------------------------------------------
                else
                    pal+=Buffer[lookAhead]; //Añadiendo caracteres que forman un lexema
            }
//-------------------------PONIENDO TODO LO QUE ESTE ENTRE COMILLAS COMO UN SOLO TOKEN------------------
            if(cadenas){
                pal+=Buffer[lookAhead];
                if(pal.size()>1 && (pal[pal.size()-1]== '"' || pal[pal.size()-1]== '\'')) {
                    getTokens(pal);
                    pal="";
                    cadenas=false;
                }
            }
//----------------------DETECTANDO CUANDO TERMINAN LOS COMENTARIOS POR BLOQUE------------------------------------------
            if(comentariosBloque){
                if(Buffer[lookAhead] == '*' && Buffer[safeLookAhead(lookAhead+1)] == '/'){
                    comentariosBloque=false;
                    lookAhead++;
                }
            }
//----------------------------------------------------------------------------------------------------------------

            if (lookAhead>=TAM_BUFFER-1) lookAhead = -1;//reinicia el lookAhead cuando este llegó al último elemento del buffer

            IndexInput++; //aumenta el indice del input
        }
        lookAhead++;

//-----------INTRODUCE BLOQUES DE CARACTERES AL BUFFER----------------
        if(lookAhead<=0) {
            Buffer[TAM_BUFFER-1] = input[IndexInput+TAM_BUFFER-1];
            //ImprimeBuffer();
        } else Buffer[lookAhead-1] = input[IndexInput+TAM_BUFFER-1];
//--------------------------------------------------------------------
    };
}
